import React from "react";

const HouseItem = (props) => {
  const { row } = props;
  return (
    <tr>
      <td>{row.place}</td>
      <td>{row.amount}</td>
    </tr>
  );
};

const HouseItems = (props) => {
  const rows = props.houseItems.map((row, index) => {
    return <HouseItem row={row} key={index} />;
  });
  return <tr>{rows}</tr>;
};

export default HouseItems;
